import React from 'react';
import './App.css';
import Header from './components/lay-out/Header'
import ContentBlockOne from './components/lay-out/ContentBlockOne';
import ContentBlockTwo from './components/lay-out/ContentBlockTwo';
import Footer from './components/lay-out/Footer';

function App() {

  return (
    <div className="App"> 
     <Header/>
     <ContentBlockOne/>
     <ContentBlockTwo/>
     <Footer/>
    </div>
  );
}

export default App;
